import React from 'react'
import { useGetCartQuery } from '../api/cartSlice'
import CartItem from '../cart/CartItem'

const ShoppingCart = () => {

  const { data:cart, isLoading, isSuccess, isError, error } = useGetCartQuery('getCart')

  let contentCart;
  if (isLoading) {
    contentCart = <p>"Loading..."</p>;
  } else if (isSuccess) {
    contentCart = cart.ids.map(cartItemId=> <CartItem key={cartItem.id} cartItem={cartItem.id}/>)
  } 


  return (
    <div>{contentCart}</div>
  )
}

export default ShoppingCart
